import React from "react";
import { useRouter } from "next/router";

const PostPage: React.FC = () => {
  const router = useRouter();
  const { community, uuid } = router.query;

  return (
    <div>
      {community}
      {uuid}
    </div>
  );
};

export default PostPage;
